// src/App.jsx

import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import HomePage from './pages/HomePage';
import AboutPage from './pages/AboutPage';
import AuthorList from './components/AuthorList';
import AuthorForm from './components/AuthorForm';
import BookList from './components/BookList';
import BookForm from './components/BookForm';
import PublisherList from './components/PublisherList';
import PublisherForm from './components/PublisherForm';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="content">
          <Switch>
            <Route path="/" exact component={HomePage} />
            <Route path="/about" component={AboutPage} />
            <Route path="/authors" exact component={AuthorList} />
            <Route path="/authors/new" component={AuthorForm} />
            <Route path="/books" exact component={BookList} />
            <Route path="/books/new" component={BookForm} />
            <Route path="/publishers" exact component={PublisherList} />
            <Route path="/publishers/new" component={PublisherForm} />
          </Switch>
        </div>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
